mapper.delete:

delete from s_b_yincomm_sub
where mm_sn = #{mmSn,jdbcType=VARCHAR}
  and sensor_code = #{sensorCode,jdbcType=VARCHAR}
  and sensor_sn = #{sensorSn,jdbcType=INTEGER}

mapper.select:

select mm_sn, sensor_code, sensor_sn, make_time, ytdata_time, sensor_status, signal_strength, 
value_type, value_int, value_num, value_str, special_flag, special_area, bak1, bak2, 
bak3
from s_b_yincomm_sub
where mm_sn = #{mmSn,jdbcType=VARCHAR}
  and sensor_code = #{sensorCode,jdbcType=VARCHAR}
  and sensor_sn = #{sensorSn,jdbcType=INTEGER}
